import React from "react";
import Sucess from "../../../assets/sucess.svg";
import Button from "../../../components/Button";
import { Overlay } from "./styles";
import styled from "styled-components";

export const Modal = styled.div`
  /* max-width: 100%; */
  min-width: 40vw;
  height: 65vh;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: space-evenly;
  background: #fff;
  padding: 1rem;

  h1 {
    font-size: 20px;
  }

  p {
    width: 80%;
    font-size: 14px;
  }
  strong {
    margin-left: 0.5rem;
    text-decoration: underline;
    cursor: pointer;
  }
  h3 {
    text-transform: uppercase;
    font-size: 16px;
    color: #85144b;
    cursor: pointer;
  }

  img {
    -webkit-text-fill-color: rebeccapurple;
  }
`;

export default function ModalSucess() {
  return (
    <Overlay>
      <Modal>
        <h1>Cadastro de Pessoa física concluído!</h1>
        <img src={Sucess} />
        <p>
          Enviamos um e-mail de confirmação para <b>name@email.com</b>.
          Verifique sua caixa de entrada para prosseguir.
        </p>
        <p>
          Caso não tenha recebido a confirmação, clique em
          <strong>Reenviar email.</strong>
        </p>
        <Button onClick={() => {}} text="cadastrar pessoa jurídica" />
        <h3>fazer login</h3>
      </Modal>
    </Overlay>
  );
}
